class Solution {
public:
    string minWindow(string s, string t) {
        int s_l = s.length(), t_l = t.length();
        //cout << "length " << s_l << ", " << t_l << endl;
        unordered_map<char, int> m_t;
        
        vector<int> Count_T; 
        int t_s = 0;
        for (int i = 0; i < t_l; ++i) {
            if(m_t.count(t.at(i))) {
                Count_T[m_t.find(t.at(i))->second]++;
            } else {
                Count_T.push_back(1);
                m_t[t[i]]= t_s++;
            }
        }
       
        pair<int,int> min = make_pair(999999,-1);
        vector<Ca> Count_A;
        Ca cp1(t_s);
        //cout << ": "<< cp1.left[3]<< cp1.left[2]<<  cp1.left[1]<<  cp1.left[0]<<  endl;
        //cout  << ": "<< cp1.right[3]<< cp1.right[2]<<  cp1.right[1]<<  cp1.right[0]<<  endl;
        int total_count = 0;
        for (int i= 0 ; i < s_l; ++i) {
            //cout << s[i] << ": "<< cp1.left[3]<< cp1.le.[2]<<  cp1.left[1]<<  cp1.left[0]<<  endl;
            
            if(m_t.count(s.at(i))) {
                //cout << s[i] << ": "<< cp1.left[3]<< cp1.left[2]<<  cp1.left[1]<<  cp1.left[0]<<  endl;
                //cout << s[i] << ": "<< cp1.right[3]<< cp1.right[2]<<  cp1.right[1]<<  cp1.right[0]<<  endl;
                cp1.right[m_t.find(s.at(i))->second]++;
                Ca cp2 = cp1;
                Count_A.push_back(cp2);
                //cout << s[i] << "left: "<< cp2.left[3]<< cp2.left[2]<<  cp2.left[1]<<  cp2.left[0]<<  endl;
                //cout << s[i] << "right: "<< cp2.right[3]<< cp2.right[2]<<  cp2.right[1]<<  cp2.right[0]<<  endl;
                cp1.left[m_t.find(s.at(i))->second]++;
                total_count++;
            } else {
                Ca cp2 = cp1;
                Count_A.push_back(cp2);
                total_count++;
            }
            //cout << i << endl;
        }

        int a = 0 , b = 0 ;
        //total_count = s_l;
        //cout << total_count << endl;

        for(int i = 0 ; i < total_count; ++i) {
            // cout << s[i] << ": "<< cp1.left[3]<< cp1.left[2]<<  cp1.left[1]<<  cp1.left[0]<<  endl;
            // cout << s[i] << ": "<< cp1.right[3]<< cp1.right[2]<<  cp1.right[1]<<  cp1.right[0]<<  endl;
            //cout << b << ": "<< Count_A[b]->right[3]<< Count_A[b]->right[2]<<  Count_A[b]->right[1]<<  Count_A[b]->right[0]<<  endl;
            // if(b== total_count-1 && !check(Count_A[a].left, Count_A[b].right, Count_T, Count_T.size()))
            //     break;

            while(b != total_count-1 && !check(Count_A[a].left, Count_A[b].right, Count_T, Count_T.size())) {
                b++;
            }

            

            //cout << i << " check: "<< a<< "," << b << endl;
            if (min.first >= (b - a + 1) && check(Count_A[a].left, Count_A[b].right, Count_T, Count_T.size())){
                //cout << "min: "<< a<< "," << b << endl;
                min.first= b-a+1;
                min.second = a; 
                
            }
            a++;
            //cout << i << endl << endl;
        }

        //cout << "Last : "<< min.first<< "," << min.second << endl;
        return min.second == - 1 ? "" : s.substr(min.second,min.first);
        
    }

    bool check(const vector<int> &left, const vector<int> &right, const vector<int> &total, int size) {
        bool b= true; 

        //cout << "hello" << left[0] << endl;

        //cout <<endl<< left[2]<<  left[1]<<  left[0]<< " : " << right[2]<< right[1]<<  right[0] << " = " << total[2] << total[1] << total[0] <<  endl;
        //cout <<endl<< left[2]<<  left[1]<<  left[0]<< " : " << right[2]<< right[1]<<  right[0] << " = " << total[2] << total[1] << total[0] <<  endl;
        //cout <<left[3]<< left[2]<<  left[1]<<  left[0]<< " : " << right[3]<< right[2]<< right[1]<<  right[0]<<  endl;
        
        for(int i = 0; i < size; i++) {
            bool j = right[i] - left[i] - total[i] >= 0 ? 1 : 0;
            //cout << j ;
            b = b & j;
        }
        //cout << endl <<"b= " << b << endl;
        return b;
    }
};


